**Purpose**

To record a summary or overview detailing the history and context of use for a specified type of implantable medical device.

**Misuse**

Not to be used to request a medical device. Use a relevant INSTRUCTION archetype for this purpose.

Not to be used to record the activities that occur in the insertion or removal of an implant. Use the ACTION.procedure archetype for this purpose.

